const Communities = ({}) => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
      }}
    >
      <Header />
      <div className={styles.classification}>
        <Classification />
      </div>
      <div className={styles.joinCommunity}>
        <JoinCommunity />
      </div>
      <div>
        <CommunityDetailClick />
      </div>
      <div>
        <Post />
        <Post />
      </div>
    </div>
  );
};
export default Communities;
